import React from "react";
import styled from "styled-components";
import "../styles/footer.css";

const CustomFooter = styled.footer`
  height: 45px;
  background: #c1bcb0;
  font-family: "Open Sans Condensed", sans-serif;
  letter-spacing: 0.5px;
  column-count: 2;
`;

function Footer() {
  return (
    <CustomFooter>
      <p className="chat-bo">Need help? Click here to get touch with us</p>
      <p className="copyright">&copy; 2019 All Services in One Place, all rights reserved</p>
    </CustomFooter>
  );
}

export default Footer;
